import React from "react";
import styled from "styled-components";

const TitleAndFilter: React.FC = () =>{
    return (
    <Container>
     <Title>들어온 요청</Title>
     <Subscription> 파트너님에게 딱 맞는 요청서를 찾아보세요</Subscription>
     <Filter>

    <Processing id="processing">
    <option value="">가공 방식</option>
    <option value="밀링">밀링</option>
    <option value="선반">선반</option>
    </Processing> 

    <Matter id="processing">
    <option value="재료">재료</option>
    <option value="알루미늄">알루미늄</option>
    <option value="구리">구리</option>
    <option value="탄소강">탄소강</option>
    <option value="합금강">합금강</option>
    <option value="강철">강철</option>
    </Matter> 

     </Filter>
    </Container>
    )

}

export default TitleAndFilter

const Container =styled.div`
width: 80%;
margin: 0 auto;
margin-top: 2rem;
`
const Title = styled.h1`
color: ${props=> props.theme.color.gray};
font-size: 20px;
font-weight: 700;
`
const Subscription = styled.div`
margin-top: 1rem;
color: ${props=> props.theme.color.gray};
font-size: 16px;
`
const Filter =styled.div`

`
const Processing =styled.select`

`
const Matter = styled.select`
`
